import { Route, BrowserRouter as Router } from "react-router-dom";
import Home from './Pages/Home';
import Gallery from './Pages/Gallery';

export const App = () => {
  return (
    <Router>
      <Route path="/" component={Home} />
      <Route path="/" component={Gallery} />
    </Router>
  );
};
